import React from "react";
import "./AboutMe.css";

const AboutMe = () => {
  return (
    <section className="aboutContainer" id="about-me">
      <h2><i className="fas fa-user-alt"></i> About Me</h2>
      <p>Hi! I'm Navdeep Kaur, a web application developer with a passion for building creative and efficient solutions. I'm currently pursuing a Graduate Certificate in Computer Software and Database Development at Loyalist College, Toronto. With two years of experience as a Mobile App Developer, I specialize in Java, JavaScript, and database technologies. Beyond coding, I enjoy painting, cooking, and dancing. I thrive on learning and collaborating to bring ideas to life through technology.</p>
    </section>
  );
};

export default AboutMe;
